Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

冲刺轮数 = 0;
if(!_parent.冲刺轮数总数){
	_parent.冲刺轮数总数 = 2;
}

冲刺轮数+=0.5;
if(冲刺轮数 >= _parent.冲刺轮数总数){
	_parent.动画完毕();
}

if(冲刺轮数 >= _parent.冲刺轮数总数){
	_parent.动画完毕();
}else{
	gotoAndPlay("开始冲刺");
	//gotoAndPlay(95);
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力 * 1.5;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 0.1;
   击中后子弹的效果 = "空手攻击火花";
   升高速度 = 10;
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果,NaN,升高速度);
}

